//The parts of navbar.js and whole Navbar.css is from https://github.com/DevLHB/navbar-app
import React, { useState } from "react";
import "./Navbar.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
const Navbar = () => {

  function Home() {
    return <h2>Home</h2>;
  }

  function About() {
    console.log("OK")
    return <h2>About</h2>;
  }

  function Users() {
    return <h2>Users</h2>;
  }

  const [isOpen, setIsOpen] = useState(false);
  return (
    <Router>
    <div className="Navbar">
      <span className="nav-logo">AppName</span>
      <div className={`nav-items ${isOpen && "open"}`}>
        <a href="/home">Home</a>
        <a href="/about">Thresholding</a>
        <a href="/about">About</a>

      </div>
      <div
        className={`nav-toggle ${isOpen && "open"}`}
        onClick={() => setIsOpen(!isOpen)}
      >
        <div className="bar"></div>
      </div>
    <Routes>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>

        </Routes>
    </div>

    </Router>
  );
};

export default Navbar;
